import { Routes, Route } from "react-router-dom";
import Listado from "./componentes/ListadoLugares";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Listado />} />
      </Routes>
    </div>
  );
}

export default App;
